import React from 'react'
import fournisseur from '../../data/fournisseur';

function TableFournisseur ()  {
  return (
    <div className="scrolling-touch">
    {fournisseur.map((fournisseurs) => (

        <div tabIndex={0} className="collapse collapse-close border border-base-300 bg-base-200"> 

            <div className="collapse-title text-xl font-medium" key={fournisseurs.id} src={fournisseurs.photo} >
            I have collapse-close class
          </div>
          <div className="collapse-content"> 
            <p>tabIndex={0} attribute is necessary to make the div focusable</p>
          </div>  
          </div>

         ))}
    </div>
  )
}

export default TableFournisseur;
